import './card-profile.module.scss'

function CardProfile({ name, hashtags, image}) {
  return (
    <article className="card-profile">
      <figure className="card-profile__figure">
        <img
          src={image}
          className="card-profile__image"
          width={190}
          height={190}
          alt="Аватар."
        />
      </figure>
      <b>{name}</b>
      <p
        className="card-profile__text"
        dangerouslySetInnerHTML={{ __html: hashtags }}
      />
    </article>
  );
}

export default CardProfile;
